description:
In Algeria, the government decided that in the 19 provinces affected by the curfew policy, the following types of businesses would be required to close at 7 PM starting December 17, 2020, and extending for 15 days until January 1, 2021:
- trade in household appliances;
- trade in household and decorative items;
- the trade in bedding and furnishing fabrics;
- trade in sporting goods;
- trade in games and toys;
- places of concentration of shops;
- hairdressing salons for men and women;
- pastries and confectionery;
- cafes, restaurants and fast food (limited to take-out)

